import React, { Component } from "react";
import Navbar from '.././components/navbar.js';


class FrontPage extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    const { context } = this.props;

    return (
      <div>
        <Navbar />
      </div>
    );
  }
}

export default FrontPage;
